import { useState } from 'react';

const RegisterPage = () => {
const [name, setName] = useState('');
const [location, setLocation] = useState('');
const [startDate, setStartDate] = useState('');
const [endDate, setEndDate] = useState('');
    const handleChange = (evt) => {
        if(evt.target.name == 'name') {console.log(evt);}
    };
    return (
        <div>
            <form >
    <div className="form-group">
      <label for="name">Name:</label>
      <input type="name" className="form-control" id="name" placeholder="Enter name" name="name" onChange={handleChange} />
    </div>

    <div className="form-group">
      <label for="location">Location:</label>
      <input type="location" className="form-control" id="location" placeholder="Enter location" name="location"/>
    </div>

    <div className="form-group">
      <label for="startDate">Start Date:</label>
      <input type="startDate" className="form-control" id="startDate" placeholder="Enter start date" name="startDate"/>
    </div>

    <div className="form-group">
      <label for="endDate">End Date:</label>
      <input type="endDate" className="form-control" id="endDate" placeholder="Enter end date" name="endDate"/>
    </div>




    <button type="submit" className="btn btn-primary">Submit</button>
  </form>

        </div>
    )
}

export default RegisterPage;
